I’m very proud of what we’ve accomplished here on this EP, with virtually no previous knowledge of recording and producing, we’ve created a record that I think is pretty good for two guys recording in a bedroom. Hope all of you think so too. 
Let me know what you guys think of the EP and think of the two songs that I wrote (God Song & Christian Jihadists). 
I am currently working on the debut single for my side-project @madisonwest_sxe and as soon as that single is out we are going to be working on new NPTF material. Expect a couple of more NPTF songs before this year is out. 
